          "comment": "Progressing and won well at Salisbury nine days ago; much respected despite 5lb penalty",
          "spotlight": "Progressive sort, building on his fine reappearance in finishing third of 21 at York (7f, good) last month when winning at Salisbury (7f, good to firm) nine days ago; has a 5lb penalty, but it's likely he has further improvement in him and he's much respected.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-08-28",
              "horse": "Crimson Spirit",
              "horse_id": "4924738",
              "race": "Juddmonte EBF Restricted Maiden Stakes (For Horses In Bands B, C And D) (EBF Qualifier) (GBB Race)",
              "race_id": "846621",
              "course": "Epsom",
              "course_id": "crs_442",
              "distance_f": "7",
              "distance_y": "1543",
              "quote": "Crimson Spirit was always in a nice rhythm. He wasn't trying to run to freely early on. He got a nice flow through, found a little gap and picked up nicely. The ground was much nicer than at Nottingham. I was pleased with the way he took me down that hill. We should have some fun with him next year as well - Richard Kingscote, rider."
            }
          ],
          "stable_tour": [
            {
              "horse": "Crimson Spirit",
              "horse_id": "4924738",
              "quote": "He ran really well on his reappearance at York. He's a lovely, big, scopey gelding with lots to look forward to as the season progresses. He handles any track, he's versatile and he's a fun horse who should be winning more races. We're looking at Salisbury for him on Sunday. 11-06-25"
            }
          ],
