          "comment": "Still well treated under 5lb penalty for Chepstow win, but has a bit to prove over 7f",
          "spotlight": "Seemed to have lost his way, but took advantage of a slipping mark when winning under Elizabeth Gale at Chepstow (1m, good) eight days ago; still well treated on his previous form despite his 5lb penalty, but has a bit to prove back down in trip.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-06-16",
              "horse": "Great Blasket",
              "horse_id": "4409423",
              "race": "bettingsites.co.uk Betting Sites Handicap (Chepstow Mile Series Qualifier)",
              "race_id": "896098",
              "course": "Chepstow",
              "course_id": "crs_312",
              "distance_f": "8",
              "distance_y": "1774",
              "quote": "It was a stressful ride. I got locked down the rail and I thought a little bit of space would come but it didn't. Great Blasket has been tough today - I haven't even picked my stick up on him. I'm lucky the gaps came up late on and he went for me - Elizabeth Gale, jockey, speaking to Sky Sports Racing."
            },
            {
              "date": "2024-06-13",
              "horse": "Great Blasket",
              "horse_id": "4409423",
              "race": "Follow Us On X @betrhino Handicap",
              "race_id": "868125",
              "course": "Nottingham",
              "course_id": "crs_1040",
              "distance_f": "8.5",
              "distance_y": "1835",
              "quote": "We'll check Great Blasket over tomorrow but as long as he comes out of the race okay I can't think why he wouldn't take his chance. He's a very hardy horse. He won first time for us and we probably didn't know how to ride him the next few times on the all-weather. Kieran Shoemark won on him at Southwell, where we said we'd drop him out and try to get there as late as possible, and since then he's won four from five. The change of tactics has definitely worked in his favour. I think stepping up to higher grade races suits him down to the ground, a harder pace and better quality of horses gives him a better target to aim at - Jamie Insole, joint-trainer."
            },
            {
              "date": "2023-08-16",
              "horse": "Great Blasket",
              "horse_id": "4409423",
              "race": "Coast To Curragh Charity Cycle Handicap (Div II)",
              "race_id": "847517",
              "course": "Gowran Park",
              "course_id": "crs_4784",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Great Blasket did that nicely and was tough. We were a little bit worried that the ground would be a bit sharp for him but Shane said he travelled around nicely. He'll probably step up to a mile the next day - George Murphy, assistant trainer."
            }
          ],
