              "distance_f": "12",
              "distance_y": "2618",
              "quote": "Fighting Poet doesn't wear blinkers for fashion purposes and things had to go right, but he's got the talent to run well. After his last run, he seems to be improving a little bit recently and we've changed his training regime a little bit. Leah [Brundle], who looks after him, has done a great job. They're a great couple and I'm delighted for them. I'm also delighted for the Adlestrop Club. They are wonderfully enthusiastic people and we've had some fun over the years and it's nice to finally get his head in front for them - Trainer Richard Phillips, speaking on Sky Sports Racing."
