              "course": "Epsom",
              "course_id": "crs_442",
              "distance_f": "7",
              "distance_y": "1543",
              "quote": "Graduated looks like she's really progressed from her first few runs. Last week at Brighton I didn't think she had an overly hard race against the 1-14 shot Praetorian and we had to play second fiddle to him. We tried to dictate it here and it went well. She's still got the entry [sales race at York] next Thursday and, while we're not guaranteed a run, we'll take a view about it. We'll see how she is after the weekend but it could be a possibility. Seven furlongs is definitely her trip but with the prize-money on offer I wouldn't be opposed to dropping her back in trip for one run and she has a turn of foot - Jamie Insole, joint-trainer."
