          "owner": "David Lowe",
          "owner_id": "own_899976",
          "prev_trainers": [],
          "prev_owners": [],
          "comment": "Yet to add to his 2yo win but ran well on all four appearances this spring",
          "spotlight": "Returned from a break with four decent runs (all over 6f) this spring and continues to edge down the weights; now 0-29 since his 2yo success but probably won't be far away; sports refitted cheekpieces.",
          "medical": [
            {
              "date": "2022-02-03",
              "type": "Wind Surgery"
            }
          ],
          "quotes": [
            {
              "date": "2021-06-11",
              "horse": "Mojomaker",
              "horse_id": "3366893",
              "race": "British Stallion Studs EBF Novice Stakes (GBB Race)",
              "race_id": "784969",
              "course": "Sandown",
              "course_id": "crs_1404",
              "distance_f": "5",
              "distance_y": "1110",
              "quote": "We always thought a lot of Mojomaker and there was a reason we took him to the Lily Agnes first time out at Chester as we thought he was good enough to win there. He didn't handle the track on the day but he left that well and truly behind at Goodwood last time. I think he should have won but he threw the race away. He can hang a bit and be a bit of a lad but we put a new bit on his bridle today and it has worked a treat. Pat (Cosgrave, jockey) got off him at Goodwood and said he would love to run him over five furlongs at Sandown. We were very bullish coming down. There is a Listed race back here next month and we will probably look at something like that ahead of the Molecomb at Goodwood - David Loughnane, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Mojomaker",
              "horse_id": "3366893",
              "quote": "He was consistent last year, winning a Sandown novice over 5f as well as running some other good races. We had him gelded in the spring and the improvement is noticeable at home. He returned to action at Doncaster last month and was desperately unlucky not to win as he was in front a stride before and after the line, but not on the line. He has gone up 3lb for that effort, which I'm sure he'll handle as I think he'll progress into a black-type horse. 11-05-22"
            }
          ],
