          "comment": "Looked stretched by 3m2f here last month; still lightly raced over fences; a player",
          "spotlight": "Close third over C&D (soft) on chasing debut in September and returned from break with good second behind progressive rival over hurdles in April; weakened rather tamely in the straight when back over fences here (3m2f, good) last month but this drop back in trip looks the right move; cheekpieces (worn once in 2023) refitted.",
          "medical": [
            {
              "date": "2023-12-15",
              "type": "Wind Surgery"
            }
          ],
          "quotes": [
            {
              "date": "2022-04-19",
              "horse": "Dancingontheedge",
              "horse_id": "4217678",
              "race": "Follow @AtTheRaces On Twitter Mares' Open National Hunt Flat Race (Cat 1 Elimination) (GBB Race)",
              "race_id": "807384",
              "course": "Worcester",
              "course_id": "crs_2626",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "I didn't expect her to do that. I ride Dancingontheedge at home, she was very calm and quiet in the paddock but as soon as she got out onto the track she surprised me. We went a decent gallop and the way she went about it was pleasing - Harry Cobden, jockey."
            }
          ],
          "stable_tour": [
            {
              "horse": "Dancingontheedge",
              "horse_id": "4217678",
              "quote": "She's a big, fine daughter of Kapgarde and I love the sire's stock, for no particular reason other than he gets some smashing individuals who get better as they get older, and I've been lucky with them. When that happens you tend to buy more of them. This mare had been no morning glory at home - early on she had so much trouble getting up our hill that one day we virtually had to get off and push her - so I was surprised when she made a winning debut in a bumper at Worcester in April. She ran a bit fresh and free at Chepstow on her hurdling debut this month and needs a couple of runs for educational experience, so I suspect we'll see her at her best handicapping in the spring. 31-10-22"
            }
          ],
