          "comment": "Back-to-back chase efforts are solid and reverts to hurdles off same mark; should go well.",
          "spotlight": "Showed little in four runs in points this year but returned to rules with a good second in a Newton Abbot hunter chase (3m2f, good) last month, then bettered that when winning a handicap chase at Stratford (2m6f, good) last week for this stable, ridden by Tom Broughton; reverts to hurdles off the same mark and should be competitive again.",
          "medical": [],
          "quotes": [
            {
              "date": "2022-11-08",
              "horse": "Gateau De Miel",
              "horse_id": "3292567",
              "race": "Irish Stallion Farms EBF Beginners Chase",
              "race_id": "825910",
              "course": "Fairyhouse",
              "course_id": "crs_4732",
              "distance_f": "24",
              "distance_y": "5252",
              "quote": "Gateau De Miel did that really well. I was concerned with the ground but he handled it well. He was really good. He's been in a while but we will definitely have a look at something over the next few weeks - Henry de Bromhead, trainer."
            },
            {
              "date": "2021-08-30",
              "horse": "Gateau De Miel",
              "horse_id": "3292567",
              "race": "Randox Health Maiden Hurdle",
              "race_id": "792263",
              "course": "Downpatrick",
              "course_id": "crs_4654",
              "distance_f": "21.5",
              "distance_y": "4780",
              "quote": "It's difficult over that trip to keep going out in front the whole way. Gateau De Miel travelled away and jumped well. At least he came on from his good run the last day so it is nice to get his head in front. He enjoyed that ground and being out in front, so hopefully there might be more to come from him - Darragh O'Keeffe, rider"
            }
          ],
          "stable_tour": [
            {
              "horse": "Gateau De Miel",
              "horse_id": "3292567",
              "quote": "I was delighted with the way he won at Fairyhouse last week and Rachael Blackmore gave him a super ride. I have to admit I was a bit concerned about the ground, but he handled it well. He looked to be running very well the time before but I'd say I was running him on the wrong ground. He came back a bit sore, so we said we'd try him with a bit more ease. The race at Fairyhouse looked a very suitable race conditions-wise and, although he's been in a while, we'll definitely look for something else in the next few weeks. 14-11-22"
            }
          ],
